        private void SquareOfNumberToOne_Click(object sender, EventArgs e)
        {
            for(int i=1; i<=500; i++)
            {
                var output = FindSquareOfNumberIsOne(i);
                Console.WriteLine(string.Format("{0} ==> {1}", i, output));
            }
            Console.ReadLine();
        }

        private bool FindSquareOfNumberIsOne(int number)
        {
            int slowPointer = SquareAndSum(number.ToString());
            int fastPointer = SquareAndSum(number.ToString());
            fastPointer = SquareAndSum(fastPointer.ToString());
            while(slowPointer != fastPointer)
            {
                slowPointer = SquareAndSum(slowPointer.ToString());
                fastPointer = SquareAndSum(fastPointer.ToString());
                fastPointer = SquareAndSum(fastPointer.ToString());
            }
            if (slowPointer == 1)
                return true;

            return false;
        }

        private int SquareAndSum(string number)
        {
            int processingVlue = 0;
            foreach(char c in number)
            {
                int a = Convert.ToInt32(c.ToString());
                int b = a * a;
                processingVlue += b;
            }
            return processingVlue;
        }

