        private int FindPossibleSteps(int input)
        {
            int prev1 = 1;
            int prev = 2;
            int temp = 0;
            for(int i=3; i<= input; i++)
            {
                temp = prev + prev1;
                prev1 = prev;
                prev = temp;
            }
            return temp;
        }

