        private int KaprekarsConstant(int num)
        {
            int counter = 0;
            int EXPECTED = 6174;

            while (num != EXPECTED)
            {
                int min = GetSortedNumber(num, true);
                int max = GetSortedNumber(num, false);

                num = max - min;
                counter++;
            }
            return counter;
        }

        private static int GetSortedNumber(int num, bool isAsc)
        {
            List<int> arr = new List<int>();
            var res = new List<int>();
            while (num > 0)
            {
                arr.Add(num % 10);
                num = num / 10;
            }
            if (isAsc)
            {
               res  = arr.OrderBy(x => x).ToList();
            }
            else
            {
                res = arr.OrderByDescending(x => x).ToList();
                while(res.Count < 4)
                {
                    res.Add(0);
                }
            }
            
            return Convert.ToInt32(string.Join("", res));
        }

