        private void ReverseTheInteger_Click(object sender, EventArgs e)
        {
            Console.WriteLine("Input Ineger is: ");
            int x = Convert.ToInt32(Console.ReadLine());
            bool isNegative = false;
            if(x < 0)
            {
                isNegative = true;
                x = 0 - x;
            }

            int res = 0;
            int prev = 0;
            while(x > 0)
            {
                int mod = x % 10;
                res = (res * 10) + mod;
                if((res-mod)/10 != prev)
                {
                    res = 0;
                }

                x = x / 10;
                prev = res;
            }
            if(isNegative)
            {
                res = 0 - res;
            }
            Console.WriteLine("");
            Console.WriteLine("");
            Console.WriteLine("");
            Console.WriteLine($"The reversed Integer is {res}");
        }

        private void IsPalindrome_Click(object sender, EventArgs e)
        {
            var res1 = IsPalindromeNumber(121);
            var res2 = IsPalindromeNumber(12321);
            var res3 = IsPalindromeNumber(1212);
            var res4 = IsPalindromeNumber(-121);
        }

        public bool IsPalindromeNumber(int x)
        {
            if (x < 0)
            {
                return false;
            }
            else if (x < 10)
            {
                return true;
            }

            int divisor = 1;
            while (x / divisor >= 10)
            {
                divisor *= 10;
            }

            while (x > 0)
            {
                int leading = x / divisor;
                int trailing = x % 10;

                if (leading != trailing)
                {
                    return false;
                }

                x = (x % divisor) / 10;
                divisor /= 100;
            }

            return true;
        }

        private void RomanToInt_Click(object sender, EventArgs e)
        {
            Console.WriteLine("Input the Roman Letter");
            string x = Console.ReadLine();
            var result = RomanToInteger(x);
            Console.WriteLine($"Output is {result}");
        }

        public int RomanToInteger(string str)
        {
            string curr = "";
            int res = 0;
            string next = "";
            int len = str.Length;
            int i = 0;

            while (i < len)
            {
                curr = str[i].ToString();
                if (i < len - 1)
                {
                    next = str[i + 1].ToString();
                }
                else
                {
                    res = res + GetValue(curr);
                    return res;
                }

                int currValue = GetValue(curr);
                int nextValue = GetValue(next);
                if (nextValue > currValue)
                {
                    int newValue = nextValue - currValue;
                    res += newValue;
                    i += 2;
                }
                else
                {
                    res += currValue;
                    i++;
                }
            }
            return res;
        }

        private int GetValue(string s)
        {
            switch (s.ToUpper())
            {
                case "I":
                    return 1;
                case "V":
                    return 5;
                case "X":
                    return 10;
                case "L":
                    return 50;
                case "C":
                    return 100;
                case "D":
                    return 500;
                case "M":
                    return 1000;
                default:
                    return 0;
            }

        }

