        private bool IsUglyNumber(int number)
        {
            while(number > 1)
            {
                if (number % 2 == 0)
                    number = number / 2;
                else if (number % 3 == 0)
                    number = number / 3;
                else if (number % 5 == 0)
                    number = number / 5;
                else
                    return false;
            }
            return true;
        }

