        private List<int> GetReverseFibonacciNumbers(int num1, int num2)
        {
            List<int> result = new List<int>();
            result.Add(num1);
            result.Add(num2);
            int x = int.MaxValue;

            if (num1 == 1 && num2 == 0)
                return result;
            
            if(num1 >= num2 && num1 >= 1 & num2 >= 0)
            {
                while(x > 0)
                {
                    x = num1 - num2;
                    result.Add(x);
                    num1 = num2;
                    num2 = x;
                }
                if(x < 0)
                {
                    return new List<int> { -1 };
                    //return result;
                }
            }
            else
                return new List<int> { -1 };
            return result;
        }

