        public int[] KthSmallestPrimeFraction(int[] A, int K)
        {
            SortedDictionary<double, string> sortedDict = new SortedDictionary<double, string>();
            for (int i = 0; i < A.Length; i++)
            {
                for (int j = i + 1; j < A.Length; j++)
                {
                    double dbl = (double)A[i] / A[j];
                    string str = A[i] + "/" + A[j];
                    sortedDict.Add(dbl, str);
                }
            }
            string res = sortedDict.Skip(K-1).FirstOrDefault().Value;
            string[] split = res.Split('/');
            return new int[] { Convert.ToInt32(split[0]), Convert.ToInt32(split[1]) };
        }

