        public List<int[]> kSmallestPairs(int[] nums1, int[] nums2, int k)
        {
            SortedSet<Tuplex> pq = new SortedSet<Tuplex>();
            int m = nums1.Length, n = nums2.Length;
            List<int[]> res = new List<int[]>();
            if (nums1 == null || nums1.Length == 0 || nums2 == null || nums2.Length == 0 || k <= 0)
            {
                return res;
            }

            for (int j = 0; j <= n - 1; j++)
            {
                pq.Add(new Tuplex(0, j, nums1[0] + nums2[j]));
            }

            for (int i = 0; i < Math.Min(k, m * n); i++)
            {
                Tuplex t = pq.ElementAt(0);
                //pq.ElementAt(0).val = count--;
                //pq.RemoveWhere(q => (q.val == t.val && q.x == t.x && q.y == t.y));
                pq.Remove(t);
                res.Add(new int[] { nums1[t.x], nums2[t.y] });
                if (t.x == m - 1)
                    continue;
                pq.Add(new Tuplex(t.x + 1, t.y, nums1[t.x + 1] + nums2[t.y]));
            }
            return res;
        }

        public List<int[]> kSmallestPairs_V2(int[] nums1, int[] nums2, int k)
        {
            List<Tuplex> pq = new List<Tuplex>();
            int m = nums1.Length, n = nums2.Length;
            List<int[]> res = new List<int[]>();
            if (nums1 == null || nums1.Length == 0 || nums2 == null || nums2.Length == 0 || k <= 0)
            {
                return res;
            }

            for (int j = 0; j <= n - 1; j++)
            {
                pq.Add(new Tuplex(0, j, nums1[0] + nums2[j]));
            }

            for (int i = 0; i < Math.Min(k, m * n); i++)
            {
                Tuplex t = pq.ElementAt(0);
                pq.RemoveAt(0);

                res.Add(new int[] { nums1[t.x], nums2[t.y] });
                if (t.x == m - 1)
                    continue;
                pq.Add(new Tuplex(t.x + 1, t.y, nums1[t.x + 1] + nums2[t.y]));
                pq = pq.OrderBy(x => x.val).ThenBy(y => y.x).ToList();
            }
            return res;
        }

        private int KthSmallestElementInMatrix(int[,] matrix, int k)
        {
            SortedList<int, Tuple<int, int>> s = new SortedList<int, Tuple<int, int>>(new DuplicateComparer<int>());

            for(int i=0; i<matrix.GetLength(0); i++)
            {
                s.Add(matrix[i, 0], new Tuple<int, int>(i, 0));
            }
            int result = -1;

            while(k-- > 0)
            {
                var topElement = s.ElementAt(0);
                int key = topElement.Key;
                Tuple<int, int> val = topElement.Value;

                int x = val.Item1;
                int y = val.Item2;

                result = key;

                s.RemoveAt(0);

                if(y < matrix.GetLength(0) - 1)
                {
                    s.Add(matrix[x, y+1], new Tuple<int, int>(x, y+1));
                }
            }
            return result;
        }

