        {
            Console.WriteLine("My Attoi for 123 is " + MyAtoi("123"));
            Console.WriteLine("My Attoi for -123 is " + MyAtoi("-123"));
            Console.WriteLine("My Attoi for       123 is " + MyAtoi("     123"));
            Console.WriteLine("My Attoi for       -123 is " + MyAtoi("     -123"));
            Console.WriteLine("My Attoi for    -   123 is " + MyAtoi("  -   123"));
            Console.WriteLine("My Attoi for 123456789 is " + MyAtoi("123456789"));
            Console.WriteLine("My Attoi for -123456789 is " + MyAtoi("-123456789"));
            Console.WriteLine("My Attoi for 123456789123456789 is " + MyAtoi("123456789123456789"));
            Console.WriteLine("My Attoi for -123456789123456789 is " + MyAtoi("-123456789123456789"));
            Console.WriteLine("My Attoi for str is " + MyAtoi("str"));
            Console.WriteLine("My Attoi for NULL is " + MyAtoi(null));
