        private int MyAtoi(string str)
        {
            if(string.IsNullOrEmpty(str) || string.IsNullOrWhiteSpace(str) )
            {
                return -1;
            }
            int sign = 1;
            long prev = 0;
            bool hasNumberStarted = false;

            for(int i=0; i< str.Length; i++)
            {
                if(!hasNumberStarted && (int)str[i] >= 48 && (int)str[i] < 58)
                {
                    hasNumberStarted = true;
                }
                if (!hasNumberStarted && str[i] == ' ')
                    continue;

                if (!hasNumberStarted && str[i] == '-')
                {
                    hasNumberStarted = true;
                    sign = -1;
                    continue;
                }

                if(hasNumberStarted && (int)str[i] >= 48 && (int)str[i] < 58)
                {
                    prev = 10 * (prev + (int)str[i] - (int)'0');
                    if (prev > int.MaxValue)
                    {
                        if (sign > -1)
                            return int.MaxValue;
                        else
                            return int.MinValue;
                    }
                }
                else
                    return 0;
            }

            return (int)prev/10 * sign;
        }
    }

    class Tuplex : IComparable<Tuplex>
    {
        public int x, y, val;
        public Tuplex(int x, int y, int val)
        {
            this.x = x;
            this.y = y;
            this.val = val;
        }

        public int CompareTo(Tuplex other)
        {
            var resVal = this.val - other.val;
            //return resVal;
            var resX = this.x - other.x;
            var resY = this.y - other.y;
            if (resVal == 0 && resX == 0 && resY == 0)
                return this.val - other.val;
            else
                return this.val - other.val;
        }
    }

    public class DuplicateComparer<TKey> : IComparer<TKey> where TKey : IComparable
    {
        public int Compare(TKey x, TKey y)
        {
            var res = x.CompareTo(y);
            return res == 0 ? 1 : res;
        }
    }
